import Vue from 'vue';
import Router from 'vue-router';


//core routes
const display_file = () => import('@/components/DisplayFile.vue');

Vue.use(Router);

export default new Router({
    mode: 'history',
    base: window.location.pathName,
    // scrollBehavior (to, from, savedPosition) {
    //   return { x: 0, y: 0 }
    // },
    routes: [
        {
          path: '/display',
        	name: 'display_file',
            component: display_file,
        },
    ]
})
